commits.content:
.article {
  padding: 1rem;
}

.comments {
  padding: 0;
  margin: 1rem 0 0;
  list-style: none;
}

.comment {
  padding: 0.75rem 0;
  border-bottom: 1px solid var(--color-divider);
}

.form {
  margin-top: 1rem;
}

.field {
  width: 100%;
  display: block;
  max-width: 600px;
}

.button {
  margin-top: 1rem;
}
